import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on the first product card to open the detail modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();

    // 2. Wait for the product detail modal to be visible
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_visible.png'));

    // 3. Click the "Add to Wish List" button inside the modal
    const addToWishlistButton = page.getByRole('button', { name: 'Add to Wish List' });
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification
    const notification = page.locator('.notification.success');
    await notification.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_added.png'));

    // 5. Extract data to verify the action
    const notificationText = await notification.textContent();
    const wishlistData = await page.evaluate(() => localStorage.getItem('amazonWishlist'));
    const parsedWishlist = JSON.parse(wishlistData);

    return {
      success: true,
      action: "Added a product to the wishlist",
      extractedData: {
        notification: notificationText,
        wishlistItemCount: parsedWishlist.length,
        firstItemTitle: parsedWishlist.length > 0 ? parsedWishlist[0].title : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
